 <li style=";tab-stops:list 36.0pt"><b>fullname</b>: Nombre del curso que se creará</li>
 <li style=";tab-stops:list 36.0pt"><b>format</b>: Formato del curso que se creará (topics, weeks ...)<br></li>
 <li style=";tab-stops:list 36.0pt"><b>templatecourse</b>: Nombre corto del curso que
     servirá como plantilla. </li><li style=";tab-stops:list 36.0pt"><b>category</b>: Id de la categoría en la que se creará el curso (1 - Miscellaneous).<br></li>
</ul>

